css:
atom-text-editor[data-grammar="source python"] .autocomplete-suggestion-list.select-list.popover-list .suggestion-description-content,
:host .autocomplete-suggestion-list.select-list.popover-list .suggestion-description-content {
  white-space: pre-wrap;
}
autocomplete-python-suggestion {
  width: auto;
  display: inline-block;
  min-width: 200px;
  max-width: 800px;
  color: #dad9d9;
  padding: 5px 0;
  padding-left: 0.6em;
  padding-right: 0.6em;
  min-height: 2em;
  line-height: 1.3;
  background: #13171d;
  border-radius: 0 0 4px 4px;
  max-height: 286px;
  overflow-y: scroll;
  white-space: pre-wrap;
  font-family: Source Code Pro;
}
